      "cell_type": "markdown",
      "source": [
        "# **Cyclistic Data Analysis Case Study**"
      ],
      "metadata": {
        "id": "Pu6XRoY5SGuD"
      }
    },
    {
      "cell_type": "markdown",
      "source": [
        "**Introduction** <br>\n",
        "\n",
        "Welcome to the Cyclistic bike-share analysis case study conducted by the marketing analytics team at Cyclistic, a leading bike-share program in Chicago. This case study explores the behavior of casual riders and annual members to formulate effective strategies aimed at increasing annual memberships.\n",
        "\n",
        "Cyclistic operates a bike-share program with a fleet of over 5,800 bicycles across 600 docking stations in Chicago. Since its inception in 2016, Cyclistic has provided inclusive transportation options, including reclining bikes and hand tricycles, catering to various rider needs.\n",
        "\n",
        "**Methodology**<br>\n",
        "The analysis will follow the standard data analysis process: Ask, Prepare, Process, Analyze, Share, and Act."
      ],
      "metadata": {
        "id": "_mqa5O6J8TNE"
      }
    },
    {
      "cell_type": "markdown",
      "source": [
        "#1. Ask Phase: Define the Objectives"
      ],
      "metadata": {
        "id": "4LGoYxk2SE0p"
      }
    },
    {
      "cell_type": "markdown",
      "source": [
        "**Objective:** <br>\n",
        "Understand how annual members and casual riders use Cyclistic bikes differently.\n",
        "\n",
        "**Business Task:** <br>\n",
        "Identify the key differences in usage patterns between annual members and casual riders to inform marketing strategies and operational improvements.\n",
        "\n",
        "**Key Deliverables:**\n",
        "- A detailed report highlighting the differences in usage patterns between annual members and casual riders.\n",
        "- Visualizations that clearly depict these differences.\n",
        "- Actionable recommendations based on the insights derived from the data analysis.\n",
        "\n",
        "**Stakeholders:**\n",
        "- *Marketing Team*: Interested in understanding user behavior to tailor marketing campaigns.\n",
        "- *Operations Team*: Looking to optimize bike distribution and availability.\n",
        "- *Executive Team*: Focused on strategic decisions to increase membership and improve customer satisfaction.\n"
      ],
      "metadata": {
        "id": "7pfpGL-9T1ZT"
      }
    },
    {
      "cell_type": "markdown",
      "source": [
        "# 2. Prepare Phase: Data Preparation"
      ],
      "metadata": {
        "id": "DgTHNl2ESUXR"
      }
    },
    {
      "cell_type": "markdown",
      "source": [
        "Used [Cyclistic’s historical trip data](https://divvy-tripdata.s3.amazonaws.com/index.html) to analyze and identify trends.\n",
        "\n",
        "Data has been made available by Motivate International Inc. under this [license](https://www.divvybikes.com/data-license-agreement).\n",
        "\n",
        "**Key Tasks:**\n",
        "- Downloaded data and store it appropriately.\n",
        "- Identify how it’s organized.\n",
        "- Sort and filter the data.\n",
        "- Determine the credibility of the data.\n",
        "\n",
        "**Deliverable:** <br>\n",
        "A description of all data sources used.\n"
      ],
      "metadata": {
        "id": "DyzHZwl_WPv_"
      }
    },
    {
