      "outputs": []
    },
    {
      "cell_type": "code",
      "source": [
        "data <- data %>%\n",
        "  mutate(day_of_week = wday(started_at, label = TRUE),\n",
        "         hour = hour(started_at),\n",
        "         month = month(started_at),\n",
        "         year = year(started_at))"
      ],
      "metadata": {
