      },
      "execution_count": null,
      "outputs": []
    },
    {
      "cell_type": "code",
      "source": [
        "hour_bins <- c(0, 6, 12, 18, 24)\n",
        "hour_labelsCat <- c(\"0-6 hrs\", \"6-12 hrs\", \"12-18 hrs\", \"18-24 hrs\")\n",
        "hour_labels <- c(\"Night\", \"Morning\", \"Afternoon\", \"Evening\")\n",
        "\n",
        "data <- data %>%\n",
        "  mutate(time_category = cut(hour, breaks = hour_bins, labels = hour_labels, include.lowest = TRUE),\n",
        "         hour_category = cut(hour, breaks = hour_bins, labels = hour_labelsCat, right = FALSE))"
      ],
      "metadata": {
        "id": "-Zdzjs_OwYxt"
