    {
      "cell_type": "markdown",
      "source": [
        "Monthly Ride Counts by User Type\n",
        "\n"
      ],
      "metadata": {
        "id": "E9Ul9Tc-9WWx"
      }
    },
    {
      "cell_type": "code",
      "source": [
        "monthly_counts <- data %>%\n",
        "  group_by(month_name, usertype) %>%\n",
        "  summarise(count = n(), .groups = \"drop\") %>%\n",
        "  arrange(match(month_name, month.name), usertype)\n",
        "\n",
        "ggplot(monthly_counts, aes(x = month_name, y = count, fill = usertype)) +\n",
        "  geom_bar(stat = 'identity', position = 'dodge') +\n",
        "  geom_text(aes(label = count), position = position_dodge(width = 0.9), vjust = -0.5) +  # Add this geom_text layer\n",
        "  labs(x = 'Month', y = 'Count', title = 'Monthly Ride Counts by User Type') +\n",
        "  theme_minimal() +\n",
        "  theme(axis.text.x = element_text(angle = 45, hjust = 1))"
      ],
