    {
      "cell_type": "markdown",
      "source": [
        "Time of Day Counts by User Type"
      ],
      "metadata": {
        "id": "oTnLXL9fsneb"
      }
    },
    {
      "cell_type": "code",
      "source": [
        "hourly_counts <- data %>%\n",
        "  group_by(time_category, usertype) %>%\n",
        "  summarise(count = n(), .groups = \"drop\") %>%\n",
        "  arrange(match(time_category, c(\"Night\", \"Morning\", \"Afternoon\", \"Evening\")), usertype)\n",
        "\n",
        "ggplot(hourly_counts, aes(x = time_category, y = count, fill = usertype)) +\n",
        "  geom_bar(stat = 'identity', position = 'dodge') +\n",
        "  geom_text(aes(label = count), position = position_dodge(width = 0.9), vjust = -0.5, size = 3, color = \"black\") +  # Add this geom_text layer\n",
        "  labs(x = 'Time of Day', y = 'Count', title = 'Ride Counts by User Type and Time of Day') +\n",
        "  scale_x_discrete(labels = c(\"Night\", \"Morning\", \"Afternoon\", \"Evening\")) +\n",
        "  theme_minimal() +\n",
        "  theme(axis.text.x = element_text(angle = 45, hjust = 1))"
      ],
