    {
      "cell_type": "markdown",
      "source": [
        "Ride Count by Hour and Day for Casual Users"
      ],
      "metadata": {
        "id": "GoUtUyVIEvc1"
      }
    },
    {
      "cell_type": "code",
      "source": [
        "casual_data <- data %>%\n",
        "  filter(usertype == \"casual\")\n",
        "\n",
        "hourly_counts <- casual_data %>%\n",
        "  group_by(hour_category, day_of_week) %>%\n",
        "  summarise(count = n(), .groups = \"drop\") %>%\n",
        "  arrange(hour_category)\n",
        "\n",
        "ggplot(hourly_counts, aes(x = hour_category, y = day_of_week, fill = count)) +\n",
        "  geom_tile() +\n",
        "  labs(x = \"Hour of the Day\", y = \"Day of the Week\",\n",
        "       title = \"Heatmap of Ride Counts by Hour and Day for Casual Users\") +\n",
        "  scale_fill_gradient(low = \"lightblue\", high = \"darkblue\") +\n",
        "  theme_minimal() +\n",
        "  theme(axis.text.x = element_text(angle = 45, hjust = 1))"
      ],
